import React, { Component } from 'react'
import styled from 'styled-components'
import sass from '../images/sass.png'
import react from '../images/react.png'
import boot from '../images/boots.png'
import npm from '../images/npm.png'
import github from '../images/github.png'
import html from '../images/html.png'
import css from '../images/css.png'
import javascript from '../images/javascript.png'
import wordpress from '../images/wordpress.png'
import photoshop from '../images/photoshop.png'
import mailchimp from '../images/mailchimp.png'

const Container = styled.div`
width:100%;
justify-content:center;
align-items:center;
padding-bottom: 4%;
margin:0 auto;
height:100%;
background:#6b222d;
`

const ContainerInner = styled.div`
display: flex;
flex-wrap: wrap;
justify-content: center;
margin-bottom:1%;
@media(min-width:768px){
  display: flex;
  flex-wrap: no-wrap;
  justify-content: center;
  margin-bottom:1%;
}
`

const Image = styled.img`
height:75px;
width:75px;
`

const Heading = styled.p`
padding: 0px;
color:white;
margin:0 auto;
`

const Box = styled.div`
display: flex;
flex-direction:column;
justify-content: center;
margin:0px 15px;
transition: 200ms ease-in
&:hover{
  transform:scale(1.40);
  margin:0px 15px;
}
@media(max-width:1024px){
  margin:15px 15px;
}
`

class Gallery extends Component {
  render() {
    return (
      <div className="row">
        <Container id="Hobbies">
          <ContainerInner>
          <Box>
           <Image src={sass} alt=""/>
           <Heading>Sass</Heading>
          </Box>
          <Box>
           <Image src={css} alt=""/>
           <Heading>Css</Heading>
           </Box>
          <Box>
           <Image src={html} alt=""/>
           <Heading>Html</Heading>
           </Box>
          <Box>
           <Image src={javascript} alt=""/>
           <Heading>Javascript</Heading>
           </Box>
          <Box>
          <Image src={react} alt=""/>
          <Heading>React.js</Heading>
          </Box>
          <Box>
           <Image src={boot} alt=""/>
           <Heading>Bootstrap</Heading>
           </Box>
          <Box>
           <Image src={wordpress} alt=""/>
           <Heading>Wordpress</Heading>
           </Box>
          <Box>
          <Image src={npm} alt=""/>
          <Heading>Npm</Heading>
          </Box>
          <Box>
          <Image src={github} alt=""/>
          <Heading>Github</Heading>
          </Box>
          <Box>
           <Image src={photoshop} alt=""/>
           <Heading>Photoshop</Heading>
           </Box>
          <Box>
           <Image src={mailchimp} alt=""/>
           <Heading>Mailchimp</Heading>
           </Box>
           </ContainerInner>
        </Container>
      </div>
    );
  }
}
export default Gallery;
